[RealWifeStories.com / Brazzers.com] Nikki Benz, Britney Amber (Friday, I`m in Love / 04.10.10)


Nikki and Scott`s marriage is in a rut. She`s working two jobs while he lays around the house all day. All signs point to a divorce until one day when Nikki`s friend Britney comes over for a week. Nikki has always had this fantasy of having a threesome with her and when she learns that Scott is more than game, she`s doubly ecstatic. Not only does she get a piece of muff to go with her beef jerky, but by the end of the week, she will have saved her marriage.


